import { Grid } from "@mui/material";
import Feed from "./components/Feed";
import Leftbar from "./components/Leftbar";
import Navbar from "./components/Navbar";
import Rightbar from "./components/Rightbar";

const App = () => {
  return (
    <div>
      <Navbar />
      <Grid container>
        <Grid item sm={2} sx={{ background: "red" }}>
          <Leftbar />
        </Grid>
        <Grid item sm={7} sx={{ background: "blue" }}>
          <Feed />
        </Grid>
        <Grid item sm={3} sx={{ background: "yellow" }}>
          <Rightbar />
        </Grid>
      </Grid>
    </div>
  );
};

export default App;
